import React, { Component } from "react";
import Cards from "../Cards";
import CardItem from "../CardItem";
import "./Registrationpage1.css";
import { createMuiTheme } from "@material-ui/core";
import { Card, Button } from 'react-bootstrap';




export default class Registerpage1 extends Component {

  RegisterPage(name){
    this.props.history.push(`/replyContactUsRequest/${name}`);
}


    render() {
       
          
            return (
                <div className='card2 '>
      <h1>Select your user type?</h1>
      <div className="cards__container2">
        <div className="cards__wrapper2">
        
          <ul className="cards__items2">
            
          <Card style={{ width: '16rem',height:'35rem', backgroundColor:'white' }}>
      <Card.Img variant="top" className='cardImage12' src='https://www.theproche.com/wp-content/uploads/2020/07/mobile-app-users.png' />
      <Card.Body>
          <p style={{ fontSize:'20px'}}><b></b></p>
          <p style={{ color:'black' }}>Author :</p>
          <p style={{ color:'black' }}>Published  </p>
          <p style={{ color:'black' }}></p>
        <Button variant="primary" style={{ alignContent:'center' }}  >View</Button>
      </Card.Body>
    </Card>
              
              
            </ul>
            
            </div>
        </div>
      
      </div>
    
    
              )
          
        
      
                   
    }
}
